// Loop over all incoming items
for (const item of $input.all()) {
    try {
        // Navigate through the nested structure to get to the content
        // The structure is: item.json.output[0].content[0].text
        const modelOutputText = item.json.output[0].content[0].text;

        // Parse the JSON string
        const parsedJson = JSON.parse(modelOutputText);

        // Extract the desired fields and add them to the item's JSON
        item.json.match_score = parsedJson.match_score;

        // **START: ADDED TITLE, COMPANY NAME, AND JOB LINK**
        item.json.job_title = parsedJson.job_title;
        item.json.company_name = parsedJson.company_name;

        // CORRECTED: Extract job_link directly from the model's JSON output
        item.json.job_link = parsedJson.job_link || 'N/A'; 
        // **END: ADDED TITLE, COMPANY NAME, AND JOB LINK**

        item.json.reasoning = parsedJson.reasoning;
        item.json.draft_email = parsedJson.draft_email;
        item.json.status = parsedJson.status;

        // Optionally, remove the original output structure to clean up the data
        delete item.json.output;

    } catch (error) {
        // Handle cases where the model output is malformed or not valid JSON
        console.error(`Error parsing model output for item. Error: ${error.message}`);
        // Add error fields so the item doesn't break downstream nodes
        item.json.match_score = null;
        item.json.job_title = item.json.title || 'N/A'; // Use original title if available
        item.json.company_name = item.json.company_name || 'N/A'; // Use original company name if available
        item.json.job_link = 'N/A'; // Set default link value on error
        item.json.reasoning = `Parsing Error: ${error.message}`;
        item.json.draft_email = '';
        item.json.status = 'Error';
    }
}
return $input.all();
